import React, { Component } from 'react';
import '../style/components/LoginBox.css';

class LoginBox extends Component {
  render() {
    return (
      <div className="container">
        <div className="box">
          <h1>TrybeWallet</h1>
          <input
            data-testid="email-input"
            type="text"
            placeholder="E-mail"
          />
          <input
            data-testid="password-input"
            type="text"
            placeholder="Senha"
          />
          <button
            type="submit"
          >
            Entrar

          </button>
        </div>
      </div>
    );
  }
}

export default LoginBox;
